import './MainPage.css'

export default function MainPage(){
    return(
        <div>
            <button className='button'>MainPage!</button>
            <a href="login.html" className="home-login-btn">로그인</a>
            <a style="display: none" href="user.html" className="home-mypage-btn">
                <div className="profile-image" style="background: #bdbdbd"><img className="profile" src="/images/profile.jpeg" /></div>
            </a>
            <a style="display: none" onclick="logout()" className="home-logout-btn">로그아웃</a>

            <div>
                <div className="mainpage">
                    <img src="images/main-symbol.png" width="100px" /><br />
                    <img src="images/main-logo.png" width="250px" />
                </div>
                <div className="iframe-container">
                    <iframe id="rightIframe" src="https://lottie.host/embed/67e1faa4-2645-461f-a6f0-4952bc6e94c8/9K3VEbwQTX.json"></iframe>
                    <iframe id="leftIframe" src="minigame.html"></iframe>
                </div>
                <div className="menus">
                    <div className="buttons">
                        <a href="game.html" className="button">게임 시작</a>
                        <a href="docs.html" className="button">게임 설명</a>
                        <a href="leader.html" target="_blank" className="button">리더보드</a>
                    </div>
                    <div className="leader_board">
                        <div className="btns load" style="margin: 30px 2px"></div>
                        <div id="board"></div>
                        <script src="leader.js"></script>
                        <script>

                        </script>
                    </div>
                </div>

                <script src="login.js"></script>
            </div>
        </div>
    )
}
